  const contacts = [
    {
        dept: "SALES",
        name: "VAISHNAVI",
        contact: 8573905565
    },
    {
        dept: "OPERATIONS",
        name: "riya",
        contact:8572009265 
    },
    {
        dept: "HUMAN-RESOURCE",
        name: "Sejal",
        contact: 85769381132
    }

];

return(
  <div>
  <h2 className='contactsub'>Support Contacts</h2>
  {contacts.map(contact => (<List
    dept = {contact.dept}
    name = {contact.name}
    contact = {contact.contact}
  />))}
  </div>
)
}

export default Contact;

